import React from "react";


const Track = ({ track, handleToggle }) => {

  const handleClick = (e) => {
    e.preventDefault()
    handleToggle(e.currentTarget.id)
  }
  return (
      <div
      id={track.number}
      name="track"
      key={track.number + track.title}
      value={track.number}
      onClick={handleClick}
      className={track.complete ? "track strike" : "track"}>
        {track.title}
      </div>
  );
};

export default Track;
